import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const Detail = ()=>{

    const {id} = useParams();

    const [dog,setDog] = useState({})

    useEffect(() => {
        axios(`http://localhost:3001/dog/${id}`)
        .then(({ data }) => setDog(data));

    },[id]);

    return(
        <div>
            <h1>Esta es la Vista de Detail</h1>
            {dog.name ? (
                <>
                <h1>{dog.name}</h1>
                <img src={dog.image.url} alt='imagen' />
                <h2>{dog.temperament}</h2>
                <h2>{dog.weight}</h2>
                <h2>{dog.life_span}</h2>
                </>
            ):(
                <h3>Loading...</h3>
            )}
        </div>
    )
}

export default Detail;
